import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

import styled from 'styled-components';
import { Butt } from '../Butt';
import { Navs } from './styles/Navs';
import { FaAlignRight} from 'react-icons/fa'


export default class NavC extends Component {
	render() {
		{/*
        https://www.iconfinder.com/icons/10496/poll_icon */}

		return (
			<Navs className="navbar navbar-expand-sm px-sm-5">



				<ul className="navbar-nav align-items-center">
					<li className="nav-item ml-5">
						<NavLink exact to="/CreM" className="nav-link" activeClassName="nav-active">
							Multiple Choice
						</NavLink>
					</li>
					<li className="nav-item ml-5">
						<NavLink exact to="/CreQ" className="nav-link" activeClassName="nav-active">
							Question and Answer
						</NavLink>
					</li>
					<li className="nav-item ml-5">
						<NavLink exact to="/CreS" className="nav-link" activeClassName="nav-active">
							Survey
						</NavLink>
					</li>
				</ul>	




			</Navs>
		);
	}
}
